// Funcao que ficara atualizando as caracteristcas de cada particula
// Tempo de vida, trajetoria...
void updateParticula(struct Particula *particula){
    // Decrementa o tempo de vida da particula pelo tempo do ultimo update de frame
    particula->tempoVivido = particula->tempoVivido - tempo_gasto;

    // Calcula movimento
    glPushMatrix();

 //   particula->pos[2] = ((particula->pos[2] - cos(particula->angulo_sentido)) + (rand() % 40)) * tempo_gasto ;
 //   particula->pos[1] = (particula->pos[1] + sin(particula->angulo_sentido)) * tempo_gasto;

    // Definindo movimentacao em x y mas cte
    //particula->pos[0] = particula->pos[0] + 0.05f;
    //particula->pos[1] = particula->pos[1] + 0.05f;

    // Definindo movimentacao em um x, y random
    particula->pos[0] = particula->pos[0] + particula->velocidade[0];
    particula->pos[1] = particula->pos[1] + particula->velocidade[1];

    // Verificacao para nao deixar a particula passar abaixo do solo
    if((particula->pos[2] + particula->velocidade[2]) < 0.0f){
        particula->pos[2] = 0.0f;
    }
    else{
        particula->pos[2] = particula->pos[2] + particula->velocidade[2];
    }


    // Definindo posio da particula
    glTranslatef(particula->pos[0],particula->pos[1],particula->pos[2]);

    // Altera dimensao da particula
    glScalef(0.2f,0.2f,0.2f);

    // Decaimento da opacidade da particula com o tempo
    particula->cor[3] = (particula->tempoVivido) / (particula->tempoDeVida); // Alfa

    // Desenha a particula em si
    desenhaParticula(particula);

    glPopMatrix();
}

// Definicao do sistema de particulas, onde ponto ondele ficara emitindo
void SistemaDeParticulas(float xSistPart, float ySistPart, float zSistPart){

    // Varre todas as particulas para aplicar as funcoes necessarias
    for (int i = 0; i < nParticulas; i ++){
        // Verifica se a particula ja morreu para recriar-la
        // Particula morreu
        if(particula[i].tempoVivido <= 0.0){
            instanciaParticula(&particula[i],xSistPart,ySistPart,zSistPart);
        }
        // Particula ainda nao morreu mas precisa se mover
        else{
            updateParticula(&particula[i]);
        }

          //  printf("%f %f %f", particula[i].tempoVivido, particula[i].velocidade[0], particula[i].velocidade[1]);
        // Ponto de nascimento das particulas sao todos na mesma fonte
     //   particula[i].pos[0] = xSistPart + (rand() % 4);
    }

    // Sistema de atualizacao para posicao das particulas
}


void eixos(float T)
{
    glBegin(GL_LINES);

    glColor3f(1,0,0);

    glVertex3f(0,0,0);
    glVertex3f(T,0,0);

    glColor3f(0,1,0);

    glVertex3f(0,0,0);
    glVertex3f(0,T,0);

    glColor3f(0,0,1);

    glVertex3f(0,0,0);
    glVertex3f(0,0,T);

    glEnd();
};

void BaseCirculo(){
    float umin = 0;
    float umax = 360;
    float du = (umax-umin)/32;
      // float du = 4 * M_PI / 180;
    float i;
    i = umin;

    // Definindo as dimensos do cubo
    //glScaled(1.0,2.0,4.0);

    while(i <= umax){
            glPushMatrix();
                glRotated(i,0,0,1);
                glTranslated(16,0,2.0);
            glScalef(1,1,4);

                desenhaCubo();
            glPopMatrix();
        i = i + du;
    }
}

